import './App.css';

const particlesParams={
  particles: {
    line_linked: {
      shadow: {
        enable: true,
        color: "#3CA9D1",
        blur: 5
      }
    }
  }
}

class App extends Component {
  render(){
    return (
      //<Particles params={particlesParams} />
      <div className="App">
        <Navigation />
        <Logo />
        <Rank/>
        <ImageLinkForm />
              {/*<FaceRecognition/>*/}
      </div>
    );
  }
}

export default App;
